import { innerRingStyles, ringStyles } from "./styles";

const Ring = () => {
  return (
    <div style={ringStyles}>
      <div style={innerRingStyles}></div>
    </div>
  );
};

export const Clock = () => {
  let minutes = 0,
    hours = 0,
    seconds = 0;

  return <Ring />;
};
